import React from 'react';

const PageTwo =(props) => {
    const notes = props.notes


    return (
<div className={"note-list"}>
    {notes.map((note,index) => (
        <div className={"note"} key={index}>
            <h2>{note.title}</h2>
            <p>{note.body}</p>

        </div>
    ))}

</div>

    );


};
export default  PageTwo
